			<div class="content">民國九十七年前往中國四川省峨嵋山羅浮洞(現今九老洞)，將這尊全世界位階最高、唯一由皇帝親自頒旨雕刻、歷史最悠久的四川峨嵋 財神開基老祖　正尊恭迎回台，並永久供奉在台中廣天宮 財神開基祖廟，護佑台灣千千萬萬的善男信女。</div>
