<script>
	$("#preload").delay(500).fadeOut(500)




	var $all = $(".repeatList >g")
	var $color = $(".repeatList .cls-1")
	var $nolast = $(".repeatList >g").not(":last")



	var $repeat = gsap.timeline({
		paused: true,
		delay: 1.2,
	}).to($color, {
		duration: 2,
		fill: '#fff',
		ease: 'power1.in',
	}, "<").to($all, {
		duration: .5,
		opacity: 1,
		stagger: {
			amount: 1.5
