		y: 20,
		filter: 'blur(10px)',
	}, "<.6").from('.enterWrap .scroll', {
		duration: 1,
		opacity: 0,
		y: 20,
	}, "<.4")


	var $god = gsap.timeline({
		paused: true,
		delay: 1.2,
	}).from('.enterWrap .god', {
		duration: 3,
		opacity: 0,
