	}).from('.enterWrap .flag', {
		duration: .5,
		opacity: 0,
		scale: 1.2,
	})




	var $whitebox = gsap.timeline({
		paused: true,
	}).to('.map img', {
		duration: 3,
		y: 0,
		z: 0,
		ease: 'power3.inOut',
	}).to('.cloud-area', {
		duration: 4,
		yPercent: 100,
		ease: 'power3.inOut',
	}, "<").to('.cloud-area .cloud-1', {
		duration: 4,
		z: 60,
		y: -250,
		ease: 'power2.inOut',
	}, "<").to('.cloud-area .cloud-2', {
		duration: 4.5,
		z: 60,
		y: -250,
		ease: 'power2.inOut',
	}, "<")


	var $whitebox_mobile = gsap.timeline({
		paused: true,
	}).to('.map img', {
		duration: 3,
		y: 0,
		z: 0,
		ease: 'power3.inOut',
	}).to('.cloud-area', {
		duration: 4,
		yPercent: 70,
		ease: 'power3.inOut',
	}, "<").to('.cloud-area .cloud-1', {
		duration: 4,
		z: 60,
		y: -60,
		ease: 'power2.inOut',
	}, "<").to('.cloud-area .cloud-2', {
		duration: 4.5,
		z: 60,
		y: -45,
		ease: 'power2.inOut',
	}, "<")



	var $locate = gsap.timeline({
		paused: true,
		delay: 2,
	}).to('.locate-area .blow', {
		duration: 1,
		opacity: 1,
		scale: 1,
		ease: 'power3.inOut',
	}).to('.locate-area .name-area li', {
		duration: 2,
		opacity: 1,
		scale: 1,
		ease: 'power3.out',
		stagger: .2,
	}, "<.4")



	var $article = gsap.timeline({
		paused: true,
		delay: 3,
	}).to('.article-area .content', {
		duration: 2,
		opacity: 1,
		y: 0,
		ease: 'power3.out',
	}).to('.article-area .ink', {
		duration: 1,
		opacity: 1,
		scale: 1,
		ease: 'power3.out',
	}, "<.2").to('.article-area .close', {
		duration: 1,
		opacity: 1,
		scale: 1,
		ease: 'power3.out',
	}, "<.2")



	$locate.play()
	$article.play()

	if (device != 'mobile') {
		$whitebox.play()
	}else{
		$whitebox_mobile.play()
	}






	var $cloudout = gsap.timeline({
		paused: true,
	}).to('.cloud-area .cloud-1', {
		duration: 3,
		x: -500,
		opacity: 0,
		ease: 'power2.inOut',
	}).to('.cloud-area .cloud-2', {
		duration: 3.5,
		x: 500,
		opacity: 0,
		ease: 'power2.inOut',
	}, "<")


	var $cloudout_mobile = gsap.timeline({
		paused: true,
	}).to('.cloud-area .cloud-1', {
		duration: 3,
		x: -500,
		opacity: 0,
		ease: 'power2.inOut',
	}).to('.cloud-area .cloud-2', {
		duration: 3.5,
		x: 500,
		opacity: 0,
		ease: 'power2.inOut',
	}, "<").to('.cloud-area .white-box', {
		duration: 3.5,
		y: 300,
		opacity: 0,
		ease: 'power2.inOut',
	}, "<")




	var $mapout = gsap.timeline({
		paused: true,
		onComplete: function () {
			$(".enter-mapWrap").css("zIndex", 1)
		}
	}).to('.locate-area', {
		duration: 2,
		opacity: 0,
		scale: 0.5,
		'-webkit-filter': 'blur(10px)',
		ease: 'power2.inOut',
	}).to('.article-area', {
		duration: 2,
		opacity: 0,
		scale: 0.5,
		'-webkit-filter': 'blur(10px)',
		ease: 'power2.inOut',
	}, "<.2").to('.map img', {
		duration: 2,
		opacity: 0,
		ease: 'power2.inOut',
	}, "<")




	$(".enter-mapWrap .close").on("click", function () {
		if (device != 'mobile') {
			$cloudout.play()
		}else{
			$cloudout_mobile.play()
		}

		$mapout.play()

		$repeat.play()
		$god.play()
	})

</script>